import React, { useState } from "react";
import { Button, Form, Col, InputGroup } from 'react-bootstrap';
// import { Formik } from 'formik';
// let yup = require('yup');
// const { Formik } = formik;


function Register(props) {
	const [validated, setValidated] = useState(false);

	const handleSubmit = (event) => {
		const form = event.currentTarget;
		if (form.checkValidity() === false) {
			event.preventDefault();
			event.stopPropagation();
		}

		setValidated(true);
	};

	return (
		<Form noValidate validated={validated} onSubmit={handleSubmit}>
			<Form.Group as={Col} md="4" controlId="userId">
				<Form.Label>User ID</Form.Label>
				<Form.Control type="text" placeholder="User ID" required />
				<Form.Control.Feedback type="invalid">
					Please provide a valid User ID.
          </Form.Control.Feedback>
			</Form.Group>

			<Form.Group as={Col} md="4" controlId="password">
				<Form.Label>Password</Form.Label>
				<Form.Control type="text" placeholder="Password" required />
				<Form.Control.Feedback type="invalid">
					Please provide a valid Password.
          		</Form.Control.Feedback>

				<Form.Label>Password Again</Form.Label>
				<Form.Control type="text" placeholder="Password_again" required />
				<Form.Control.Feedback type="invalid">
					Please provide a valid Password.
          		</Form.Control.Feedback>
			</Form.Group>

			<Form.Group as={Col} md="4" controlId="validationCustom01">
				<Form.Label>First name</Form.Label>
				<Form.Control
					required
					type="text"
					placeholder="First name"
				/>
				<Form.Control.Feedback type="invalid">Please provide a valid First Name.</Form.Control.Feedback>
			</Form.Group>

			<Form.Group as={Col} md="4" controlId="validationCustom02">
				<Form.Label>Last name</Form.Label>
				<Form.Control
					required
					type="text"
					placeholder="Last name"
				/>
				<Form.Control.Feedback type="invalid">Please provide a valid Last Name.</Form.Control.Feedback>
			</Form.Group>


			<Form.Group as={Col} md="4" controlId="validationCustom03">
				<Form.Label>Email address</Form.Label>
				<Form.Control type="text" placeholder="Email address" required />
				<Form.Control.Feedback type="invalid">
					Please provide a valid Email.
          </Form.Control.Feedback>
			</Form.Group>



			<Button type="submit">Submit form</Button>
		</Form>
	);
}

export default Register;
